import React from 'react';
import '../stylesheets/App.css';
import Header from "./Header";
import Search from "./Search";

function App() {
  return (
    <div>
        <Header/>
        <div className="searchForm">
            <div className="container">
              <div className="row">
                  <Search/>
                <div className="col-12">
                  <hr/>
                </div>
              </div>
            </div>
        </div>
    </div>
  );
}

export default App;
